                var ps = new ParticleSlider({
                    ptlGap: isMobile || isSmall ? 3 : 0,
                    ptlSize: isMobile || isSmall ? 3 : 1,
                    width: 1e9,
                    height: 1e9
                });

             


                (window.addEventListener ? window.addEventListener('click', function () {
                    ps.init(true)
                }, false) : window.onclick = function () {
                    ps.init(true)
                });
            }

            var initParticleSlider = function () {
                var psScript = document.createElement('script');
                (psScript.addEventListener ? psScript.addEventListener('load', init, false) : psScript.onload = init);
                psScript.src = 'https://particleslider.com/js/particleslider/current/particleslider.js';
                psScript.setAttribute('type', 'text/javascript');
                document.body.appendChild(psScript);
            }

                (window.addEventListener ? window.addEventListener('load', initParticleSlider, false) : window.onload = initParticleSlider);</script>
    </body>

</html>
